$(function() {
	// open in fullscreen
	$('.requestfullscreen').click(function() {
		$('.fullscreen').fullscreen();
		return false;
	});
	
	$('.requestfullscreen1').click(function() {
		$('.fullscreen-1').fullscreen();
		return false;
	});
	$('.requestfullscreenall').click(function() {
		$('.fullscreenall').fullscreen();
		return false;
	});
	$('.requestfullscreensingle').click(function() {
		$('.fullscreen_single').fullscreen();
		return false;
	});

	// document's event
	$(document).bind('fscreenchange', function(e, state, elem) {
		// if we currently in fullscreen mode
		if ($.fullscreen.isFullScreen()) {
			$('.requestfullscreen').hide();
			$('.fullscreen table').attr('style', 'margin-top:10px;border:4px solid #999;');
			
			$('.requestfullscreen1').hide();
			$('.fullscreen-1 table').attr('style', 'margin-top:10px;border:4px solid #999; background-color: white;');

			$('.requestfullscreenall').hide();
			$('.fullscreenall table').attr('style', 'margin-top:10px;border:4px solid #999; background-color: white;');

			$('.requestfullscreensingle').hide();
			$('.fullscreen_single table').attr('style', 'margin-top:10px;border:4px solid #999; background-color: white;');
			
		} else {
			$('.requestfullscreen').show();
			$('.fullscreen table').attr('style', '');
			
			$('.requestfullscreen1').show();
			$('.fullscreen-1 table').attr('style', '');

			$('.requestfullscreenall').show();
			$('.fullscreenall table').attr('style', '');

			$('.requestfullscreensingle').show();
			$('.fullscreen_single table').attr('style', '');
		}
	});
});

//load output screen course wise seats
function load_available_seat_data(col_code) {
	var param = 'col_code=' + col_code;
	$.ajax({
		url: BASE_URL + 'reports/get_seat_available',
		data: param,
		type: 'get',
		dataType: 'json',
		success: function (r) {
			var s = '';
			$.each(r, function(index, value){
				s += '<tr class="' + ((index%2==0) ? 'even' : 'odd') + '">';
				s += '<td>' + value.crs_name + '</td>';
				var ge_extra_class =   "";
				if(value.cat_ge>0){
				    ge_extra_class =   'background-color:Chartreuse;color:black;';
				}else{
				     ge_extra_class =   '';
				}
				
				var sc_extra_class =   "";
				if(value.cat_sc>0){
				    sc_extra_class =   'background-color:DarkOrchid;color:white;';
				}else{
				     sc_extra_class =   '';
				}
					
				var st_extra_class =   "";
				if(value.cat_st>0){
				    st_extra_class =   'background-color:CornflowerBlue;color:white;';
				}else{
				     st_extra_class =   '';
				}
 				
 				var oa_extra_class =   "";
				if(value.cat_oa>0){
				    oa_extra_class =   'background-color:blue;color:white;';
				}else{
				    oa_extra_class =   '';
				}
  				
 				var ob_extra_class =   "";
				if(value.cat_ob>0){
				    ob_extra_class =   'background-color:DarkOrange;color:white;';
				}else{
				    ob_extra_class =   '';
				}
				
  				
 				var pw_extra_class =   "";
				if(value.cat_pw>0){
				    pw_extra_class =   'background-color:Aqua;color:black;';
				}else{
				    pw_extra_class =   '';
				} 
				
				s += '<td style="text-align: center; '+ ge_extra_class +' ">' + value.cat_ge + '</td>';
				s += '<td style="text-align: center; '+ sc_extra_class +' ">' + value.cat_sc + '</td>';
				s += '<td style="text-align: center; '+ st_extra_class +' ">' + value.cat_st + '</td>';
				s += '<td style="text-align: center; '+ oa_extra_class +' ">' + value.cat_oa + '</td>';
				s += '<td style="text-align: center; '+ ob_extra_class +' ">' + value.cat_ob + '</td>';
				s += '<td style="text-align: center; '+ pw_extra_class +' ">' + value.cat_pw + '</td>';
			//	s += '<td style="text-align: center;">' + value.cat_sp_ge + '</td>';
			//	s += '<td style="text-align: center;">' + value.cat_sp_sc + '</td>';
				s += '</tr>';
			});
			
			$('#seat_available tbody').html(s);
			
		}
	});
}

function load_seat_data(col_type) {
	console.log(timer);
	var param ='col_type='+col_type;
	$.ajax({
				url: BASE_URL + 'reports/get_college_available',
				data: param,
				type: 'get',
				dataType: 'json',
				success: function (res) {
					if(res.length > 0) {
						$('.col_name').html(res[num].col_code + ' - ' + res[num].col_name);
						load_available_seat_data(res[num].col_code);
						num++;
					}
					
					if(num == res.length) {
						num = 0;
					}
				}
			});
}

