//download seat status in PDF 
$(document).on('click','.download-seatstatus-pdf',function() {
	console.log(seatstatus);
	var doc 	= 	new jsPDF('l', 'mm', 'a4');
	
	// HEADER
	var page_title	=	'SMF COUNSELING';
	var page_title2	=	'Seat Status';

	//create columns
	var columns = [["COLLEGE", "COURSE", "CATEGORY", "SEATS", "FILLED", "VACANT"]];
	//create rows
	var categories = ['GEN', 'SC', 'ST', 'OBC-A', 'OBC-B', 'PW', 'GEN(S)', 'SC(S)'];
	var row_cnt = seatstatus.data.length;			
	var rows = [];
	for (var i = 0; i < row_cnt; i++) {
		var row_val = null;
		var col_val = "";
		
		var row_val_sc = null;
		var col_val_sc = "";
		var row_val_st = null;
		var col_val_st = "";
		var row_val_oa = null;
		var col_val_oa = "";
		var row_val_ob = null;
		var col_val_ob = "";
		var row_val_pw = null;
		var col_val_pw = "";
		
		col_val += (seatstatus.data[i].col_code + " - " + seatstatus.data[i].col_name) + "|" + seatstatus.data[i].crs_name + "|" + categories[0] + "|" + seatstatus.data[i].cat_ge_tot + "|" + seatstatus.data[i].cat_ge_fil + "|" + seatstatus.data[i].cat_ge_vac + "|";
		row_val = col_val.split('|').slice(0, -1);	
        
        //new
        col_val_sc += (seatstatus.data[i].col_code + " - " + seatstatus.data[i].col_name) + "|" + seatstatus.data[i].crs_name + "|" + categories[1] + "|" + seatstatus.data[i].cat_sc_tot + "|" + seatstatus.data[i].cat_sc_fil + "|" + seatstatus.data[i].cat_sc_vac + "|";
		row_val_sc = col_val_sc.split('|').slice(0, -1);	
        
        col_val_st += (seatstatus.data[i].col_code + " - " + seatstatus.data[i].col_name) + "|" + seatstatus.data[i].crs_name + "|" + categories[2] + "|" + seatstatus.data[i].cat_st_tot + "|" + seatstatus.data[i].cat_st_fil + "|" + seatstatus.data[i].cat_st_vac + "|";
		row_val_st = col_val_st.split('|').slice(0, -1);
		
		col_val_oa += (seatstatus.data[i].col_code + " - " + seatstatus.data[i].col_name) + "|" + seatstatus.data[i].crs_name + "|" + categories[3] + "|" + seatstatus.data[i].cat_oa_tot + "|" + seatstatus.data[i].cat_oa_fil + "|" + seatstatus.data[i].cat_oa_vac + "|";
		row_val_oa = col_val_oa.split('|').slice(0, -1);
		
		col_val_ob += (seatstatus.data[i].col_code + " - " + seatstatus.data[i].col_name) + "|" + seatstatus.data[i].crs_name + "|" + categories[4] + "|" + seatstatus.data[i].cat_ob_tot + "|" + seatstatus.data[i].cat_ob_fil + "|" + seatstatus.data[i].cat_ob_vac + "|";
		row_val_ob = col_val_ob.split('|').slice(0, -1);	
    
        col_val_pw += (seatstatus.data[i].col_code + " - " + seatstatus.data[i].col_name) + "|" + seatstatus.data[i].crs_name + "|" + categories[5] + "|" + seatstatus.data[i].cat_pw_tot + "|" + seatstatus.data[i].cat_pw_fil + "|" + seatstatus.data[i].cat_pw_vac + "|";
		row_val_pw = col_val_pw.split('|').slice(0, -1);	
     
		rows.push(row_val);
		rows.push(row_val_sc);
		rows.push(row_val_st);
		rows.push(row_val_oa);
		rows.push(row_val_ob);
		rows.push(row_val_pw);
		
	}   
	   
	doc.autoTable({
			startY: 20,
			head: columns,
			body: rows,
			theme: 'grid',
			styles: {
	            lineColor: [201, 201, 201],
	            lineWidth: 0.25,
	            minCellHeight: 8, 
	            valign: 'middle', 
	            fontSize: 9
	        },
	        headStyles: {
	            fillColor: [242, 242, 242],
	            textColor: 0
	        },
	        
	        didDrawPage: function (data) {
	            // Header
	            doc.setFontSize(12);
				doc.setFontStyle('bold');
				doc.alignText(0, 8, page_title.toUpperCase(), { align: 'center' });
				doc.alignText(0, 12, page_title2.toUpperCase(), { align: 'center' });

	            // Footer
	            var str = "Page " + doc.internal.getNumberOfPages()
	            // Total page number plugin only available in jspdf v1.0+
	            /*if (typeof doc.putTotalPages === 'function') {
	                str = str + " of " + totalPagesExp;
	            }*/
	            doc.setFontSize(8);
				doc.setFontStyle('normal');

	            // jsPDF 1.4+ uses getWidth, <1.4 uses .width
	            var pageSize = doc.internal.pageSize;
	            var pageHeight = pageSize.height ? pageSize.height : pageSize.getHeight();
	            doc.text(str, data.settings.margin.left, pageHeight - 10);
	        },
		});		
	
	doc.save('SEAT_STATUS');
});	

